import Car from "./Car"
import ClassComponent from "./ClassComponent"

function Garage(){
    let brandName;
    brandName = 'Dhoni';
    const stats = {
        'name': 'Dhoni',
        'age': '45',
        'experience': '23',
        'wife': 'sakshi',
        'place': 'Ranchi'
    };
    const user = [
        {id: 1, name:'krishnan', place:'chennai'},
        {id: 2, name:'Sathya', place:'chennai'},
        {id: 3, name:'Sridhar', place:'chennai'},
    ];
    return <>
        <p>Currently Available vechicles</p>
        { brandName !== undefined 
        ? <Car brandName = {brandName} status ={'cricket'} stats = {stats}/>
        : null }
        <ClassComponent stats = {stats}/>
    </>
}
export default Garage
